int dict[256];
const auto _STATIC_ = []() {
    dict['+'] = 0;
    dict['-'] = 1;
    dict['*'] = 2;
    dict['/'] = 3;
    return 0;
}();

struct Node {
    u64 hash;
    double data;

    Node(const int& type, i64 a, i64 b, i64 c, i64 d,
         const char* opab, const char* opbc, const char* opcd, const double& _data) : data(_data) {
        switch (type) {
            case 0: break;
            case 1:
                if (!valid(dict[*opab], dict[*opbc])) data = 0;
                break;
            case 2:
                if (!valid(dict[*opab], dict[*opcd])) data = 0;
                break;
            case 3:
                if (!valid(dict[*opab], dict[*opbc]) || !valid(dict[*opbc], dict[*opcd])) data = 0;
                break;
            case 4:
                if (!valid(dict[*opbc], dict[*opcd])) data = 0;
                break;
        }
        hash = 0;
        (hash += a) <<= 7;
        (hash += b) <<= 7;
        (hash += c) <<= 7;
        (hash += d) <<= 2;
        (hash += dict[*opab]) <<= 2;
        (hash += dict[*opbc]) <<= 2;
        (hash += dict[*opcd]) <<= 3;
        hash += type;
    }

    inline constexpr bool valid(const int& a, const int& b) const {
        if (a == 0) return b > 1;
        if (a == 2) return b < 2;
        return true;
    }

    bool operator<(const Node& rhs) const { return hash < rhs.hash; }
};

